import React from "react";

import { Card } from "react-bootstrap";
import "./index.css";

const card = () => {
  return (
    <>
      <div className="main_card">
        <Card className="card">
          <Card.Body>
            <div className="Search_Bar">
              <div className="input-group">
                <div className="form-outline">
                  <input type="text" className="form-control" />
                </div>

                <button type="button" className="btn search_button btn-primary">
                  <i className="fas fa-search"></i>
                </button>
              </div>
            </div>
            <div className="temp_contianer">
              <h1 className="cityName">
                {" "}
                <i className="fa-solid fa-location-dot"> </i> jaipur{" "}
              </h1>
              <h1 className="temp">20°C</h1>
              <h3 className="tempMinMax"> Min:20°C | Max :20°C</h3>
            </div>
          </Card.Body>
        </Card>
      </div>
    </>
  );
};

export default card;
